import { Route } from "react-router-dom";
import React from "react";
import Navbar from "./navBar";
function navBarTest() {
  return (
    <div>
      <Navbar></Navbar>
      <main>
        <Route path="/demontage">
          <h1>First Page</h1>
        </Route>
        <Route path="/montage">
          <h1>Second Page</h1>
        </Route>
        <Route path="/bloquage">
          <h1>Third Page</h1>
        </Route>
        <Route path="/zinguage">
          <h1>Forth Page</h1>
        </Route>
      </main>
    </div>
  );
}

export default navBarTest;
